import React, {useEffect, useState} from "react";
import axios from "axios";

function EffectTutorial() {
    const [data, setData] = useState("");
    const [data2, setData2] = useState("");
    const [data3, setData3] = useState("");
    const [data4, setData4] = useState("");
    const [data5, setData5] = useState("");
    const [count, setCount] = useState(1);
    useEffect(() => {
        axios.get("https://jsonplaceholder.typicode.com/comments")
        .then((response)=>{
            console.log("API meghívódott!");
            console.log(response.data);
            setData(response.data[0].name);
            setData2(response.data[0].email);
            setData3(response.data[0].body);
            setData4(response.data[0].id);
            setData5(response.data[0].postId);
    });
    }, []);
    return (
    <div>Hello World 
        <h1>Név: {data}</h1>
        <h1>e-mail cím: {data2}</h1>
        <h1>Szöveg: {data3}</h1>
        <h1>Azonosító: {data4}</h1>
        <h1>Post azonosító: {data5}</h1>
        <h1>{count}</h1>
        <button
        onClick={()=>{
            setCount(count +1);
        }}
        >Kattints ide!</button>
        </div>);
}

export default EffectTutorial;
